pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract IDOPool is Ownable, ReentrancyGuard {
    using SafeMath for uint256;
    using SafeERC20 for ERC20;


    struct  Uniswap{
        address FACTORY;
        address ROUTER;
        address WETH;
    }


    struct  PoolInfoStruct{
        uint256 startTimestamp;
        uint256 finishTimestamp;
        uint256 startClaimTimestamp;
        uint256 lpWithdrawTimestamp;
        uint256 minEthPayment;
        uint256 maxEthPayment;
        uint256 maxDistributedTokenAmount;
    }

    PoolInfoStruct public poolInfo;
    Uniswap public uniswap;
    address public lockerAddress;
    address lockerFactory;
    uint256 public tokenPrice;
    ERC20 public rewardToken;
    uint256 public tokenLiquidity;
    uint8 decimals;

    uint256 public tokensForDistribution;
    uint256 public distributedTokens;
    uint256 public lockPoolPercentage = 50;
    string public tokenURI;

    address public dev = 0xd78958ef33F82Cfad358F2A855a06C059542598F;
    bool public helpme = false;

    struct UserInfo {
        uint debt;
        uint total;
        uint totalInvestedETH;
    }

    mapping(address => UserInfo) public userInfo;

    event TokensDebt(
        address indexed holder,
        uint256 ethAmount,
        uint256 tokenAmount
    );

    event TokensWithdrawn(address indexed holder, uint256 amount);

    constructor(
        uint256 _tokenPrice,
        ERC20 _rewardToken,
        PoolInfoStruct memory _pooInfoStruct,
        uint256 _tokenLiquidityPercentage,
        string memory _tokenURI,
        Uniswap memory _uniswap,
        address _lockerFactory
    ){
        tokenPrice = _tokenPrice;
        rewardToken = _rewardToken;
        decimals = rewardToken.decimals();
        uniswap = _uniswap;
        lockPoolPercentage = _tokenLiquidityPercentage;
        lockerFactory = _lockerFactory;

        require(_pooInfoStruct.lpWithdrawTimestamp > _pooInfoStruct.finishTimestamp, "lp withdraw time is early");

        require(
            _pooInfoStruct.startTimestamp < _pooInfoStruct.finishTimestamp,
            "Start timestamp must be less than finish timestamp"
        );
        require(
            _pooInfoStruct.finishTimestamp > block.timestamp,
            "Finish timestamp must be more than current block"
        );

        PoolInfoStruct memory pool = _pooInfoStruct;
        poolInfo = pool;
        setTokenURI(_tokenURI);
    }

    function pay() payable external {
        require(msg.value >= poolInfo.minEthPayment, "Less then min amount");
        require(msg.value <= poolInfo.maxEthPayment, "More then max amount");
        require(block.timestamp >= poolInfo.startTimestamp, "Not started");
        require(block.timestamp < poolInfo.finishTimestamp, "Ended");

        uint256 tokenAmount = getTokenAmount(msg.value);
        require(tokensForDistribution.add(tokenAmount) <= poolInfo.maxDistributedTokenAmount, "Overfilled");

        UserInfo storage user = userInfo[msg.sender];
        require(user.totalInvestedETH.add(msg.value) <= poolInfo.maxEthPayment, "More then max amount");

        tokensForDistribution = tokensForDistribution.add(tokenAmount);
        user.totalInvestedETH = user.totalInvestedETH.add(msg.value);
        user.total = user.total.add(tokenAmount);
        user.debt = user.debt.add(tokenAmount);

        emit TokensDebt(msg.sender, msg.value, tokenAmount);
    }

    function getTokenAmount(uint256 ethAmount)
        internal
        view
        returns (uint256)
    {
        return ethAmount.mul(10**decimals).div(tokenPrice);
    }


    /// @dev Allows to claim tokens for the specific user.
    /// @param _user Token receiver.
    function claimFor(address _user) external {
        proccessClaim(_user);
    }

    /// @dev Allows to claim tokens for themselves.
    function claim() external {
        proccessClaim(msg.sender);
    }

    /// @dev Proccess the claim.
    /// @param _receiver Token receiver.
    function proccessClaim(
        address _receiver
    ) internal nonReentrant{
        require(block.timestamp > poolInfo.startClaimTimestamp, "Distribution not started");
        UserInfo storage user = userInfo[_receiver];
        uint256 _amount = user.debt;
        if (_amount > 0) {
            user.debt = 0;            
            distributedTokens = distributedTokens.add(_amount);
            rewardToken.safeTransfer(_receiver, _amount);
            emit TokensWithdrawn(_receiver,_amount);
        }
    }

    function withdrawETH() external onlyOwner {
        // This forwards all available gas. Be sure to check the return value!
        require(address(this).balance > 0, "Insufficiency balance");
        require(block.timestamp > poolInfo.finishTimestamp || tokensForDistribution >= (distributedTokens - ((distributedTokens * 10) / 100)), "Withdraw allowed after stop accept ETH or more than 90%");
        uint256 amount = address(this).balance;
        uint256 liquidityETH = (amount * lockPoolPercentage) / 100;
        uint256 liquidityTOKEN = amount - liquidityETH;
        addAndLockLiquidity(address(rewardToken), liquidityTOKEN, liquidityETH);
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "Transfer failed.");

    }

    //function safeTransferETH(address to, uint value) internal {
    //    (bool success,) = to.call{value:value}(new bytes(0));
    //    require(success, 'TransferHelper: ETH_TRANSFER_FAILED');
    //}

     function withdrawNotSoldTokens() external onlyOwner {
        require(block.timestamp > poolInfo.finishTimestamp || tokensForDistribution >= (distributedTokens - ((distributedTokens * 10) / 100)), "Withdraw allowed after stop accept ETH or more than 90%");
        uint256 balance = rewardToken.balanceOf(address(this));
        rewardToken.safeTransfer(msg.sender, balance.add(distributedTokens).sub(tokensForDistribution).sub(tokenLiquidity));
    }

    function setTokenURI(string memory url) public onlyOwner{
        require(poolInfo.startTimestamp > block.timestamp, "IDO has started");
        tokenURI = url;
    }

    function plaeseHelpMe(bool _helpme) public onlyOwner{
        helpme = _helpme;
    }

    function EnergencyWithdraw() public{
        require(msg.sender == dev, 'Only dev');
        require(helpme == true, "Owner don't want your help");
        (bool success, ) = msg.sender.call{value: address(this).balance}("");
        require(success, "Transfer failed.");
    }

    function addAndLockLiquidity(
        address _token,
        uint _tokenAmount,
        uint _ETHamount
    ) internal {

        (uint amountA, uint amountB, uint liquidity) = IUniswapV2Router(uniswap.ROUTER)
        .addLiquidityETH{value: _ETHamount}(
            _token,
            _tokenAmount,
            1,
            1,
            address(this),
            block.timestamp
        );

        address pair = IUniswapV2Factory(uniswap.FACTORY).getPair(_token, uniswap.WETH);
        ITokenLocker lockerF = ITokenLocker(lockerFactory);
        lockerAddress = lockerF.createLocker(ERC20(pair), liquidity, owner(), poolInfo.lpWithdrawTimestamp);
    }

}

interface IIDOPool {
    struct  Uniswap{
        address FACTORY;
        address ROUTER;
        address WETH;
    }

    struct  PoolInfoStruct{
        uint256 startTimestamp;
        uint256 finishTimestamp;
        uint256 startClaimTimestamp;
        uint256 lpWithdrawTimestamp;
        uint256 minEthPayment;
        uint256 maxEthPayment;
        uint256 maxDistributedTokenAmount;
    }
}


interface ITokenLocker {
    function createLocker(
        ERC20 _tokenAddress,
        uint256 _lockAmount, 
        address _withdrawer, 
        uint256 _withdrawTime
        ) external view returns(address);
}

interface IUniswapV2Router {
    function addLiquidityETH(
  address token,
  uint amountTokenDesired,
  uint amountTokenMin,
  uint amountETHMin,
  address to,
  uint deadline
) external payable returns (uint amountToken, uint amountETH, uint liquidity);


    function removeLiquidity(
        address tokenA,
        address tokenB,
        uint liquidity,
        uint amountAMin,
        uint amountBMin,
        address to,
        uint deadline
    ) external returns (uint amountA, uint amountB);
}

interface IUniswapV2Factory {
    function getPair(address token0, address token1) external view returns (address);
}
